import { Box } from "@mui/material";
import React from "react";
import { appColor } from "../../../assets/Color";
import Logo from "../../../components/header/Logo";
import waiterImage from "../../../assets/waiter.png";

const Sidebar = ({ info, links }) => {
  return (
    <Box
      sx={{
        width: "300px",
        height: "100vh",
        background: `linear-gradient(to bottom, #333, ${appColor.yellow})`,
      }}
    >
      <Box sx={{ transform: "scale(0.8)" }}>
        <Logo />
      </Box>
      <Box sx={{ textAlign: "center", margin: "20px" }}>
        <Box
          sx={{
            position: "relative",
            width: "80px",
            height: "80px",
            borderRadius: "50%",
            border: `1px solid ${appColor.yellow}`,
          }}
        >
          <img style={{ maxWidth: "100%" }} src={waiterImage} />
        </Box>
      </Box>
    </Box>
  );
};

export default Sidebar;
